import React, { Component } from 'react';

class NavBar extends Component {
    render() {
        return (<React.Fragment>
            <nav className="navbar navbar-dark bg-dark mb-3">
                <h1>Duke Badminton Club</h1>
            </nav>
          </React.Fragment>
        );
    }
}

export default NavBar;
